import styled from "styled-components";
import { Link } from "react-router-dom";
import logo from "../HOME/LogoPI.png";
import logo2 from "../HOME/LogoPIprueba.png";

export default function HomeMain() {
  return (
    <HomeContainer>
      <div className="curve"></div>
      <h1>Henry Countries</h1>
      <div>
        <img src={logo2} alt="logo" />
      </div>

      <Intro>
        ¿Estas listo para conocer un poco sobre los paises de tu interés? Entra
        a la siguiente sección y disfruta del contenido.
      </Intro>
      <Link to="/countries">Explorar</Link>
    </HomeContainer>
  );
}

const HomeContainer = styled.main`
  display: flex;
  flex-direction: column;
  justify-content: space-around;
  align-content: space-around;
  align-items: flex-start;
  height: 50rem;
  background-color: #2b3240;
  /* position: relative; */
  padding-left: 15rem;
  img{
    height: 30rem;
  }
`;

const Intro = styled.section`
  background-color: cadetblue;
  text-align: center;
`;
